export default class User {
    korisnickoIme: string = "";
    lozinka: string = "";
    bezbedonosnoPitanje: string = "";
    odgovor: string = "";
    ime: string = "";
    prezime: string = "";
    pol: string = "";
    adresa: string = "";
    kontaktTelefon: string = "";
    imejl: string = "";
    profilnaSlika: string = "";
    tipSkole: string = "";
    razred: number = 0;
    biografija: string = "";
    predmet: Array<string> = [];
    uzrast: Array<string> = [];
    upoznavanjeSaSajtom: string = "";
    tip: number = 0;
}
